  <TR align="left" valign="center"><TH colspan="7">The operation date over XXX Calculator # Pipeline #.<?dp return "The operation date over "+Special.FLibSYS.tmFStr(time,"%d %m %Y")+" Calculator # Pipeline #.";?>
  </TH></TR>
