				prevCntr = cntr;
				if((cntr-holdCntr)/f_frq > 3)	{ holdCntr = cntr; levUp++; }
				decMult = max(2,floor(lg((max-min)/pow(10,-prmPrec))));
				newVl = info_var_arg0val +	sign(appToVl) *										//direction
