      else if( aID == "wMin" && wLst > aVl ) aVl = ""+aVl+" ... "+wLst;
      else aVl = "не установлена";
    }    
    //> Put record
    doc_tmpl += "<tr><td>"+strEnc2HTML(aDscr)+"</td><td>"+strEnc2HTML(aVl)+"</td></tr>\n";
  }
}
